--
-- Create procedure `Proc_Employee_Paging`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_Paging (IN _offset int,
IN _limit int,
IN employeeSearchTerm varchar(255),
OUT totalRecord int)
COMMENT '
  Param: _limit: Số bản ghi cần lấy
         _offset: Số bản ghi bỏ qua
         employeeSearchTerm: FullName, số điện thoại hoặc EmployeeCode cần tìm
  Output: employeeId: Id của nhân viên cần thêm
          employeeCode: Mã nhân viên
          lastName: Họ 
          firstName: Tên 
          fullName: Họ và tên 
          gender: Giới tính (0: Nam, 1: Nữ, 2: Khác)
          dateOfBirth: Ngày sinh 
          email: mail
          address: Địa chỉ 
          phoneNumber: Số điện thoại
          identityNumber: số chứng minh nhân dân 
          identityDate: Ngày cấp chứng minh nhân dân 
          identityPlace: Nơi cấp chứng minh nhân dân 
          positionId: Mã chức vụ 
          departmentId: Mã phòng ban 
          bankAccountNumber: Tài khoản ngân hàng 
          nameOfBank: Tên ngân hàng 
          bankAccountBranch: Chi nhánh
          createdBy: Người tạo
          createdDate: Ngày tạo
          modifiedDate: Ngày sửa
          modifiedBy: Người sửa 
          totalRecord: Tổng số bản ghi
  Author: LeDucTiep (06/05/2023)
  Test: CALL Proc_Employee_Paging(0, 10, "Đan", @totalRecord);
        SELECT
          @totalRecord;
'
BEGIN
  -- Lấy ra dữ liệu 
  WITH SearchedList
  AS
  (SELECT
        e.EmployeeId,
        e.EmployeeCode,
        e.FullName,
        e.Gender,
        e.DateOfBirth,
        e.Email,
        e.Address,
        e.PhoneNumber,
        e.IdentityNumber,
        e.IdentityDate,
        e.IdentityPlace,
        e.PositionId,
        e.DepartmentId,
        d.DepartmentName,
        e.CreatedDate,
        p.PositionName,
        e.BankAccountNumber,
        e.NameOfBank,
        e.BankAccountBranch,
        e.CreatedBy,
        e.ModifiedDate,
        e.ModifiedBy
      FROM employee e
        LEFT JOIN department d
          ON e.DepartmentId = d.DepartmentId
        LEFT JOIN position_ p
          ON e.PositionId = p.PositionId
      WHERE FullName LIKE CONCAT('%', employeeSearchTerm, '%')
      OR EmployeeCode LIKE CONCAT('%', employeeSearchTerm, '%')
      OR e.PhoneNumber LIKE CONCAT('%', employeeSearchTerm, '%')

      ORDER BY e.EmployeeCode)

  SELECT
    EmployeeId,
    EmployeeCode,
    FullName,
    Gender,
    DateOfBirth,
    Email,
    Address,
    PhoneNumber,
    IdentityNumber,
    IdentityDate,
    IdentityPlace,
    PositionId,
    DepartmentId,
    DepartmentName,
    CreatedDate,
    PositionName,
    BankAccountNumber,
    NameOfBank,
    BankAccountBranch,
    CreatedBy,
    ModifiedDate,
    ModifiedBy
  FROM SearchedList
  LIMIT _limit
  OFFSET _offset;

  -- Lấy ra số lượng bản ghi
  WITH SearchedList
  AS
  (SELECT
        e.EmployeeId,
        e.EmployeeCode,
        e.FullName,
        e.Gender,
        e.DateOfBirth,
        e.Email,
        e.Address,
        e.PhoneNumber,
        e.IdentityNumber,
        e.IdentityDate,
        e.IdentityPlace,
        e.PositionId,
        e.DepartmentId,
        e.CreatedDate,
        e.BankAccountNumber,
        e.NameOfBank,
        e.BankAccountBranch,
        e.CreatedBy,
        e.ModifiedDate,
        e.ModifiedBy
      FROM employee e
      WHERE FullName LIKE CONCAT('%', employeeSearchTerm, '%')
      OR EmployeeCode LIKE CONCAT('%', employeeSearchTerm, '%')
      OR e.PhoneNumber LIKE CONCAT('%', employeeSearchTerm, '%'))
  SELECT
    COUNT(*) INTO totalRecord
  FROM SearchedList;


END
$$

--
-- Create procedure `Proc_Employee_GetById`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_GetById (IN employeeId char(36))
COMMENT '
  Output: Thông tin nhân viên 
  Author: LeDucTiep (17/05/2023)
  Test: CALL Proc_Employee_GetById("1117fccb-2220-33ff-667b-d9ebc53aac3d");
