--
-- Create procedure `Proc_Customer_Paging`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Customer_Paging (IN _offset int,
IN _limit int,
IN searchTerm varchar(255),
OUT totalRecord int)
COMMENT '
  Param: _limit: Số bản ghi cần lấy
         _offset: Số bản ghi bỏ qua
         searchTerm: FullName, số điện thoại hoặc EmployeeCode cần tìm
  Output: customer.*
          totalRecord: Tổng số bản ghi
  Author: LeDucTiep (06/05/2023)
  Test: CALL Proc_Employee_Paging(0, 10, "Đan", @totalRecord);
        SELECT
          @totalRecord;
'
BEGIN
  -- Lấy ra dữ liệu 
  SELECT
    c.CustomerId,
    c.CustomerType,
    c.IsSupplier,
    c.TaxCode,
    c.CustomerCode,
    c.FullName,
    c.Address,
    c.PhoneNumber,
    c.Website,
    c.EmployeeId,
    c.ContactInforId,
    c.TermsOfPaymentId,
    c.MaxDaysOwed,
    c.MaxAmountOfDebt,
    c.AccountCollectId,
    c.AccountPayId,
    c.Note,
    c.IdentityNumber,
    c.IdentityDate,
    c.IdentityPlace,
    c.CreatedDate,
    c.CreatedBy,
    c.ModifiedDate,
    c.ModifiedBy
  FROM customer c

  WHERE c.FullName LIKE CONCAT('%', searchTerm, '%')
  OR c.CustomerCode LIKE CONCAT('%', searchTerm, '%')
  OR c.Address LIKE CONCAT('%', searchTerm, '%')
  OR c.PhoneNumber LIKE CONCAT('%', searchTerm, '%')
  OR c.IdentityNumber LIKE CONCAT('%', searchTerm, '%')

  LIMIT _limit

  OFFSET _offset;

  -- Lấy ra số lượng bản ghi

  SELECT
    COUNT(c.CustomerId) INTO totalRecord
  FROM customer c
  WHERE c.FullName LIKE CONCAT('%', searchTerm, '%')
  OR c.CustomerCode LIKE CONCAT('%', searchTerm, '%')
  OR c.Address LIKE CONCAT('%', searchTerm, '%')
  OR c.PhoneNumber LIKE CONCAT('%', searchTerm, '%')
  OR c.IdentityNumber LIKE CONCAT('%', searchTerm, '%')
  ;
END
$$

